INSERT INTO `companyinformation` (`CompanyInformationId`, `NatureOfBusines`, `Address`, `Country`, `Telephone`, `Website`, `NumberOfEmployess`, `CompanyId`) VALUES
(1, 'Erin Energy Corporation, an independent exploration and production company, engages in the acquisition and development of energy resources in Africa. Its asset portfolio consists of five licenses covering an area of approximately 6,000 square kilometers across offshore Nigeria, offshore Ghana, and offshore The Gambia. The company was formerly known as CAMAC Energy Inc. and changed its name to Erin Energy Corporation in April 2015. The company was founded in 2005 and is headquartered in Houston, Texas. Erin Energy Corporation is a subsidiary of CAMAC Energy Holdings Limited. On July 13, 2018, the voluntary petition of Erin Energy Corporation for reorganization under Chapter 11 was converted to Chapter 7. It had filed for Chapter 11 bankruptcy on April 25, 2018', '1330 Post Oak Boulevard\r\nSuite 2250\r\nHouston, TX 77056', 'United States', '713-797-2940', 'http://www.erinenergy.com', 61, 2);
